<html>
    <head>
        <meta charset=\"UTF-8\">
        <title>{% block title %}Welcome!{% endblock %}</title>
        <link rel=\"icon\" href=\"data:image/svg+xml,<svg xmlns=%22http://www.w3.org/2000/svg%22 viewBox=%220 0 128 128%22><text y=%221.2em%22 font-size=%2296%22>⚫️</text><text y=%221.3em%22 x=%220.2em%22 font-size=%2276%22 fill=%22%23fff%22>sf</text></svg>\">
        {% block stylesheets %}
            {{ encore_entry_link_tags('app') }}
        {% endblock %}

        {% block javascripts %}
            {{ encore_entry_script_tags('app') }}
        {% endblock %}
    </head>
    <body>

        <div class=\"container\">
            <nav class=\"navbar navbar-expand-xl navbar-light bg-light\">
                <a class=\"navbar-brand\" href=\"{{ path('app_home') }}\">Locky</a>
                
                <div class=\"collapse navbar-collapse\" id=\"navbarNavAltMarkup\">
                  <div class=\"navbar-nav\">
                    <a class=\"nav-item nav-link active\" href=\"{{ path('app_home') }}\">Accueil</span></a>
                    <a class=\"nav-item nav-link\" href=\"{{ path('app_prestation_add') }}\">Ajouter une prestation</a>
                    <a class=\"nav-item nav-link\" href=\"{{ path('app__my_prestation_index') }}\">Mes prestations</a>
                  </div>
                </div>
                
              <div>
                {% if app.user %}
                    <a class=\"nav-item nav-link\" href=\"{{ path('app_logout') }}\">Se deconnecter</a>
                    {% else %}
                    <a class=\"nav-item nav-link\" href=\"{{ path('app_login') }}\">Se connecter</a>
                {% endif %}
              </div>
            </nav>
        </div>
        <div class=\"container\">
            {% for label, messages in app.flashes %}
                {% for message in messages %}
                    <div class=\"alert alert-{{ label }} alert-dismissible fade show\" role=\"alert\">
                        {{ message }}
                        <button type=\"button\" class=\"btn-close\" data-bs-dismiss=\"alert\" aria-label=\"Close\"></button>
                    </div>
                {% endfor %}
            {% endfor %}
        </div>
        {% block body %}{% endblock %}
    </body>
</html>
